import db from '../../db.json'

export default function (req, res) {
  const {
    query: { id },
  } = req

  res.statusCode = 200
  res.setHeader('Content-Type', 'appication/json')
  res.end(db)

  //   res.json({ user: { id, name: 'Test User' } })
}
